import { useState } from 'react';

function Dropdown({ cookies, selection, Onselect}) {
    // currently dropdown is closed
    const [ isOpen, setIsOpen ] = useState(false); 

    // when clicked, open or close []
    const handleClick = () => {
        setIsOpen(!isOpen);
    }

}

export default Dropdown;
